import React from 'react';
import Typewriter from 'typewriter-effect';
import './App.css';

const Header = () => {
  const bemVindo = `Bem Vindo!`;
  const welcome = `You're Welcome!`;
  const bienvenido = `Bienvenido`;
  const bienvenue = `Bienvenue`;

  return (
    <div className="header-title">
      <Typewriter
        onInit={(typewriter) => {
          typewriter
          .typeString(bemVindo)
          .pauseFor(3000)
          .deleteAll()
          .typeString(welcome)
          .pauseFor(3000)
          .deleteAll()
          .typeString(bienvenido)
          .pauseFor(3000)
          .deleteAll()
          .typeString(bienvenue)
          .pauseFor(3000)
          .deleteAll()
          .start();
        }} />
    </div>
  );
}

export default Header;
